  lsat = (MPC_casadi_X.Integrator1_CSTATE_ng <=
          MPC_casadi_P.Integrator1_LowerSat);
  usat = (MPC_casadi_X.Integrator1_CSTATE_ng >=
          MPC_casadi_P.Integrator1_UpperSat);
