/* Model output function for TID2 */
void MPC_casadi_output2(void)          /* Sample time: [0.1s, 0.0s] */
{
  int32_T i;

  /* FromWorkspace: '<Root>/From Workspace1' */
  {
    real_T *pDataValues = (real_T *) MPC_casadi_DW.FromWorkspace1_PWORK.DataPtr;
    real_T *pTimeValues = (real_T *) MPC_casadi_DW.FromWorkspace1_PWORK.TimePtr;
    int_T currTimeIndex = MPC_casadi_DW.FromWorkspace1_IWORK.PrevIndex;
    real_T t = MPC_casadi_M->Timing.t[2];

    /* Get index */
    if (t <= pTimeValues[0]) {
      currTimeIndex = 0;
    } else if (t >= pTimeValues[499]) {
      currTimeIndex = 498;
    } else {
      if (t < pTimeValues[currTimeIndex]) {
        while (t < pTimeValues[currTimeIndex]) {
          currTimeIndex--;
        }
      } else {
        while (t >= pTimeValues[currTimeIndex + 1]) {
          currTimeIndex++;
        }
      }
    }

    MPC_casadi_DW.FromWorkspace1_IWORK.PrevIndex = currTimeIndex;

    /* Post output */
    {
      real_T t1 = pTimeValues[currTimeIndex];
      real_T t2 = pTimeValues[currTimeIndex + 1];
      if (t1 == t2) {
        if (t < t1) {
          {
            int_T elIdx;
            for (elIdx = 0; elIdx < 9; ++elIdx) {
              (&MPC_casadi_B.FromWorkspace1[0])[elIdx] =
                pDataValues[currTimeIndex];
              pDataValues += 500;
            }
          }
        } else {
          {
            int_T elIdx;
            for (elIdx = 0; elIdx < 9; ++elIdx) {
              (&MPC_casadi_B.FromWorkspace1[0])[elIdx] =
                pDataValues[currTimeIndex + 1];
              pDataValues += 500;
            }
          }
        }
      } else {
        real_T f1 = (t2 - t) / (t2 - t1);
        real_T f2 = 1.0 - f1;
        real_T d1;
        real_T d2;
        int_T TimeIndex = currTimeIndex;

        {
          int_T elIdx;
          for (elIdx = 0; elIdx < 9; ++elIdx) {
            d1 = pDataValues[TimeIndex];
            d2 = pDataValues[TimeIndex + 1];
            (&MPC_casadi_B.FromWorkspace1[0])[elIdx] = (real_T) rtInterpolate(d1,
              d2, f1, f2);
            pDataValues += 500;
          }
        }
      }
    }
  }

  /* Buffer: '<Root>/Buffer' */
  for (i = 0; i < 9; i++) {
    MPC_casadi_DW.Buffer_CircBuf[MPC_casadi_DW.Buffer_inBufPtrIdx + i] =
      MPC_casadi_B.FromWorkspace1[i];
  }

  MPC_casadi_DW.Buffer_inBufPtrIdx += 9;
  if (MPC_casadi_DW.Buffer_inBufPtrIdx >= 108) {
    MPC_casadi_DW.Buffer_inBufPtrIdx -= 108;
  }

  /* End of Buffer: '<Root>/Buffer' */
}

/* Model update function for TID2 */
void MPC_casadi_update2(void)          /* Sample time: [0.1s, 0.0s] */
{
  /* Update absolute time */
  /* The "clockTick2" counts the number of times the code of this task has
   * been executed. The absolute time is the multiplication of "clockTick2"
   * and "Timing.stepSize2". Size of "clockTick2" ensures timer will not
   * overflow during the application lifespan selected.
   * Timer of this task consists of two 32 bit unsigned integers.
   * The two integers represent the low bits Timing.clockTick2 and the high bits
   * Timing.clockTickH2. When the low bit overflows to 0, the high bits increment.
   */
  if (!(++MPC_casadi_M->Timing.clockTick2)) {
    ++MPC_casadi_M->Timing.clockTickH2;
  }

  MPC_casadi_M->Timing.t[2] = MPC_casadi_M->Timing.clockTick2 *
    MPC_casadi_M->Timing.stepSize2 + MPC_casadi_M->Timing.clockTickH2 *
    MPC_casadi_M->Timing.stepSize2 * 4294967296.0;
}

/* Model output function for TID3 */
void MPC_casadi_output3(void)    /* Sample time: [0.60000000000000009s, 0.0s] */
{
  real_T rtb_Buffer[54];
  int32_T i;

  /* Buffer: '<Root>/Buffer' */
  for (i = 0; i < 54; i++) {
    rtb_Buffer[i] =
      MPC_casadi_DW.Buffer_CircBuf[MPC_casadi_DW.Buffer_outBufPtrIdx + i];
  }

  i = MPC_casadi_DW.Buffer_outBufPtrIdx + 54;
  if (MPC_casadi_DW.Buffer_outBufPtrIdx + 54 == 108) {
    i = 0;
  }

  MPC_casadi_DW.Buffer_outBufPtrIdx = i;

  /* End of Buffer: '<Root>/Buffer' */

  /* RateTransition: '<S1>/RT' incorporates:
   *  Buffer: '<Root>/Buffer'
   */
  memcpy(&MPC_casadi_DW.RT_Buffer0[0], &rtb_Buffer[0], 54U * sizeof(real_T));
}

/* Model update function for TID3 */
void MPC_casadi_update3(void)    /* Sample time: [0.60000000000000009s, 0.0s] */
{
  /* Update absolute time */
  /* The "clockTick3" counts the number of times the code of this task has
   * been executed. The absolute time is the multiplication of "clockTick3"
   * and "Timing.stepSize3". Size of "clockTick3" ensures timer will not
   * overflow during the application lifespan selected.
   * Timer of this task consists of two 32 bit unsigned integers.
   * The two integers represent the low bits Timing.clockTick3 and the high bits
   * Timing.clockTickH3. When the low bit overflows to 0, the high bits increment.
   */
  if (!(++MPC_casadi_M->Timing.clockTick3)) {
    ++MPC_casadi_M->Timing.clockTickH3;
  }

  MPC_casadi_M->Timing.t[3] = MPC_casadi_M->Timing.clockTick3 *
    MPC_casadi_M->Timing.stepSize3 + MPC_casadi_M->Timing.clockTickH3 *
    MPC_casadi_M->Timing.stepSize3 * 4294967296.0;
}

