/* Model terminate function */
void MPC_casadi_terminate(void)
{
  /* Terminate for S-Function (hil_initialize_block): '<S9>/HIL Initialize' */

  /* S-Function Block: MPC_casadi/basicQCarIO/HIL Initialize (hil_initialize_block) */
  {
    t_boolean is_switching;
    t_int result;
    t_uint32 num_final_digital_outputs = 0;
    t_uint32 num_final_pwm_outputs = 0;
    t_uint32 num_final_other_outputs = 0;
    hil_task_stop_all(MPC_casadi_DW.HILInitialize_Card);
    hil_monitor_stop_all(MPC_casadi_DW.HILInitialize_Card);
    is_switching = false;
    if ((MPC_casadi_P.HILInitialize_DOTerminate && !is_switching) ||
        (MPC_casadi_P.HILInitialize_DOExit && is_switching)) {
      {
        int_T i1;
        boolean_T *dw_DOBits = &MPC_casadi_DW.HILInitialize_DOBits[0];
        for (i1=0; i1 < 16; i1++) {
          dw_DOBits[i1] = MPC_casadi_P.HILInitialize_DOFinal;
        }
      }

      num_final_digital_outputs = 16U;
    } else {
      num_final_digital_outputs = 0;
    }

    if ((MPC_casadi_P.HILInitialize_POTerminate && !is_switching) ||
        (MPC_casadi_P.HILInitialize_POExit && is_switching)) {
      MPC_casadi_DW.HILInitialize_POValues[0] =
        MPC_casadi_P.HILInitialize_POFinal;
      MPC_casadi_DW.HILInitialize_POValues[1] =
        MPC_casadi_P.HILInitialize_POFinal;
      num_final_pwm_outputs = 2U;
    } else {
      num_final_pwm_outputs = 0;
    }

    if ((MPC_casadi_P.HILInitialize_OOTerminate && !is_switching) ||
        (MPC_casadi_P.HILInitialize_OOExit && is_switching)) {
      MPC_casadi_DW.HILInitialize_OOValues[0] =
        MPC_casadi_P.HILInitialize_OOFinal;
      MPC_casadi_DW.HILInitialize_OOValues[1] =
        MPC_casadi_P.HILInitialize_OOFinal;
      num_final_other_outputs = 2U;
    } else {
      num_final_other_outputs = 0;
    }

    if (0
        || num_final_pwm_outputs > 0
        || num_final_digital_outputs > 0
        || num_final_other_outputs > 0
        ) {
      /* Attempt to write the final outputs atomically (due to firmware issue in old Q2-USB). Otherwise write channels individually */
      result = hil_write(MPC_casadi_DW.HILInitialize_Card
                         , NULL, 0
                         , MPC_casadi_P.HILInitialize_POChannels,
                         num_final_pwm_outputs
                         , MPC_casadi_P.HILInitialize_DOChannels,
                         num_final_digital_outputs
                         , MPC_casadi_P.HILInitialize_OOChannels,
                         num_final_other_outputs
                         , NULL
                         , &MPC_casadi_DW.HILInitialize_POValues[0]
                         , (t_boolean *) &MPC_casadi_DW.HILInitialize_DOBits[0]
                         , &MPC_casadi_DW.HILInitialize_OOValues[0]
                         );
      if (result == -QERR_HIL_WRITE_NOT_SUPPORTED) {
        t_error local_result;
        result = 0;

        /* The hil_write operation is not supported by this card. Write final outputs for each channel type */
        if (num_final_pwm_outputs > 0) {
          local_result = hil_write_pwm(MPC_casadi_DW.HILInitialize_Card,
            MPC_casadi_P.HILInitialize_POChannels, num_final_pwm_outputs,
            &MPC_casadi_DW.HILInitialize_POValues[0]);
          if (local_result < 0) {
            result = local_result;
          }
        }

        if (num_final_digital_outputs > 0) {
          local_result = hil_write_digital(MPC_casadi_DW.HILInitialize_Card,
            MPC_casadi_P.HILInitialize_DOChannels, num_final_digital_outputs,
            (t_boolean *) &MPC_casadi_DW.HILInitialize_DOBits[0]);
          if (local_result < 0) {
            result = local_result;
          }
        }

        if (num_final_other_outputs > 0) {
          local_result = hil_write_other(MPC_casadi_DW.HILInitialize_Card,
            MPC_casadi_P.HILInitialize_OOChannels, num_final_other_outputs,
            &MPC_casadi_DW.HILInitialize_OOValues[0]);
          if (local_result < 0) {
            result = local_result;
          }
        }

        if (result < 0) {
          msg_get_error_messageA(NULL, result, _rt_error_message, sizeof
            (_rt_error_message));
          rtmSetErrorStatus(MPC_casadi_M, _rt_error_message);
        }
      }
    }

    hil_task_delete_all(MPC_casadi_DW.HILInitialize_Card);
    hil_monitor_delete_all(MPC_casadi_DW.HILInitialize_Card);
    hil_close(MPC_casadi_DW.HILInitialize_Card);
    MPC_casadi_DW.HILInitialize_Card = NULL;
  }
}

